import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Tripon에 오신 것을 환영합니다!</h1>
        <p>여행 계획을 쉽게 만들어보세요.</p>
      </header>
    </div>
  );
}

export default App;
